import React from 'react';
import Layout from '../Components/Layout';
import { createStore } from 'react-redux';

const AppLayout = ({ Component, pageProps }) => {

	const store = createStore()
	return (
		<Layout>
			<Component {...pageProps} />
		</Layout>
	);
};
export default AppLayout;
